import React ,{Component}from 'react';
import { Text, Button, View, Alert, Image,TouchableOpacity,ScrollView,SafeAreaView,TextInput } from 'react-native';
import {styles} from '../providerStyle';
import { MaterialCommunityIcons, MaterialIcons, Ionicons } from '@expo/vector-icons';
import ToggleSwitch from 'toggle-switch-react-native';

export default class Setting extends Component {
  state = {
    messageSwitch: true,
    gpsSwitch: true,
  };
  
  onToggle(isOn) {
    console.log("Changed to " + isOn);
  }

  render() {
    return (
    <SafeAreaView style={{ flex:1, justifyContent: "center", alignItems: "center" }}>
      <View style={{alignItems: "Left" }}>
        <View style={{marginTop:15, marginBottom:15,flexDirection: 'row'}}>
          <Image
            style = {styles.smallIconImg}
            source={require('../../images/providerImg/signup_icon_setting.png')}
          />
          <Text style={{ fontSize:18, fontWeight: '500' }}>基本设置</Text>
        </View>

        <View style={{marginTop:15, marginBottom:15,flexDirection: 'row'}}>
          <Text style={{ fontSize:18, fontWeight: '500' }}>消息通知</Text>
          <ToggleSwitch
            isOn={false}
            onColor="#FF7E67"
            labelStyle={{ color: "black", fontWeight: "900" }}
            size="large"
          />
        </View>

        <View style={{marginTop:15, marginBottom:15,flexDirection: 'row'}}>
          <Text style={{ fontSize:18, fontWeight: '500' }}>验证码</Text>
          <TextInput style={styles.resumeInput} placeholder= "请输入新邮箱内收到的验证码"/>
        </View>


      </View>
        <TouchableOpacity style={styles.resumeButton}>
          <Text style={{ fontSize:16, fontWeight: '400', color: '#ffffff' }}>确认</Text>
        </TouchableOpacity>
    </SafeAreaView>
  );}
}
